import React, { Component } from 'react';
import {BrowserRouter as Router, Routes, Route} from 'react-router-dom'
import './App.css'
import Home from './pages/Home'



export default class App extends Component {
    render() {
        return (
            <div className='App'>
                <Router>
                    <Routes>
                        <Route path='/home' element={<Home />} />
                    </Routes>
                </Router>
            </div>
        );
    }
}
